const EvolutionStage = ({ pokemon }) => {
    const fetchEvolution = () => {
        fetch(`http://localhost:8080/pokemonEvolution/${pokemonID}`)
            .then(async res => {
                const evolution = await res.json();
                setEvolutionData(evolution.chain);
            })
    }

    useEffect(() => fetchEvolution(), []);

    return (
        <div>Evolution Stage</div>
    )
}

export default EvolutionStage;
